  false,\n\t\"url\": null,\n\t\"notes\": \"The Enhanced Master Station History Report
  (EMSHR) is a compiled list of basic, historical information for every station in
  the station history database, beginning in the 1700s through the present. The Enhanced
  MSHR version contains similar data elements and is in a similar format as the Standard/Legacy
  MSHR (DSI-9767_01), but the Enhanced MSHR includes additional stations that are
  included in the Global Historical Climatology Network (GHCN)-Daily product. Also,
  the Enhanced MSHR incorporates additional station networks, including international
  stations/networks. The Enhanced MSHR contains an expanded number of items to the
  original MSHR, such as station status, additional IDs, alternate station names,
  NWS region, NWS Weather Forecast Office (WFO), all elevations, latitude/longitude
  precision, and UTC offset.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
